import React, { Component } from 'react';
import { render } from 'react-dom';
import './search-panel.css';

export default class SearchPanel extends Component {

    state = {
        term: ''
    };

    render() {
        return <input
            type='text'
            className='form-control search-input'
            placeholder='search'
            value={this.state.term}
        />;
    }

};
